import React from 'react';
import './home.css';
import {Codesandbox} from 'react-feather';
import {Container, Row, Col} from 'react-bootstrap';

function home() {
    return (
        <section className = "home">
        <Container>
            <Row className = "home-content">
                <Col lg = {12} className = "my-auto my-0 d-flex align-items-center justify-content-center">
                    <Codesandbox className = "emblem-icon" size = {200}></Codesandbox>
                </Col>
                <Col lg = {12}>
                    <h3>Loading...</h3>
                </Col>
            </Row>
        </Container>   
        </section>
    )
}

export default home
